import { signInReq } from '../../services/apis/auth';

export const signIn = (obj) => (dispatch) => {
  signInReq(obj)
    .then((res) => {
      if (res.data && res.data.success) {
        console.log('hellllo', res.data.data);

        dispatch({
          type: SET_PRODUCTS,
          payload: res.data.data,
        });
      }
    })
    .catch((err) => {
      console.log({ err });
    });
};
